Решето Эратосфена можно написать следующим образом:

```
package main

import (
    "fmt"
)

func eratosthenes(limit int) []int {
    prime := make([]int, limit+1)
    for i := 2; i <= limit; i++ {
        if prime[i] == 0 { // Используем простые числа для начала
            continue
        }
        for j := i * i; j <= limit; j += i {
            prime[j] = 1 // Устанавливаем 1 для обработки
        }
    }
    return append(prime[:limit], ...)
}

func main() {
    var primes []int
    primes = eratosthenes(50)
    fmt.Println("Простые числа до 50:", primes)
}
```

Конечно! Вот простой пример решета Эратосфена в Go:

```go
