function changeGradient() {
    // Получаем текущий цвет кнопки
    var gradientColor = document.getElementById("gradient").style.backgroundColor;

    // Проверяем, что цвет не null или undefined
    if (gradientColor) {
        // Сравниваем предыдущее и текущее цвета
        if (gradientColor === "white") {
            // Если текущий цвет больше предыдущего, меняем его на белый
