Функция `MatrixFromNormal` возвращает матрицу, которая соответствует направлению вектора <point3> относительно оси Z. Матрица имеет следующие компоненты:
- Первый элемент - скалярное значение;
- Второй элемент - косинус вектора Z;
- Третий элемент - косинус вектора X;
- Четвертый элемент - косинус вектора Y.

Для нормализации вектора <point3>, нужно применить следующие преобразования:
- Увеличение вектора X и Y до единицы.
- Уменьшение вектора Z до единицы.

Результатом является матрица, совпадающая с исходной матрицей <matrix3> на векторе <point3>, но с измененными компонентами, соответствующими нормализованному вектору.

Функция `MatrixFromNormal` возвращает матрицу, соответствующую заданному вектору <point3>, сохраняющую его локальный ось Z в нормальном положении и смещение матрицы равным [0,0,0]. Величины компонента масштаба уменьшаются в противоположность нормали, что обеспечивает нормализацию вектора <point3>. Примеры использования:

- `MatrixFromNormal([0,0,1])` - вернет (matrix3 [1,0,0], [0,1,0], [0,0,1], [0,0,0])
- `MatrixFromNormal([0,1,1])` - вернет (matrix3 [0,-0.707107,0.707107] [1.41421,0,0] [0,1,1] [0,0,0])

