Функция факториала на Go:

```go
package main

import "fmt"

func factorial(n int) int {
    if n <= 1 {
        return 1
    }
    result := 1
    for i := 2; i <= n; i++ {
        result *= i
    }
    return result
}

func main() {
    fmt.Println(factorial(5)) // Вывод: 120
}
```

Эта функция принимает целое число `n` и возвращает его факториал (произведение всех чисел от 1 до `n`).

