class SoftmaxClassifier {
    constructor(inputSize) {
        this.inputSize = inputSize;
    }

    forward(inputs) {
        // Преобразование входных данных в тензоры
        const inputsTensors = inputs.map(tensor => tensor.toTensor());

        // Вычисление softmax
        const outputs = inputsTensors.map(tensor => tensor.softmax());

        return outputs;
    }
}

// Пример использования
