const inputData = [0.5, 0.6]; // Тестовый набор входных данных

const outputs = classifier.forward(inputData);

console.log(outputs); // Выводим результаты softmax
```

Этот код создает класс `SoftmaxClassifier` с одним параметром `inputSize`, которое указывает на размер входного тензора. Он затем преобразует входные данные в тензоры и применяет функцию `softmax` для каждого элемента входного тела. После этого он возвращает результаты softmax.

В этом примере используется `map` для обработки массивов входных данных, чтобы они могли быть преобразованы в тензоры. Это помогает эффективно применить функцию `softmax` к каждому элементу входного тела.

